import '../style/Main.css';
import '../style/global.css';

const Main = () => {

    return (
        <>
            <div className='main-outer'>
                <div className='main-inner'>

                    <div>
                        <h1>
                            'REM' Web Project
                            </h1>

                        <h2>
                            React - Express - MySQL(MariaDB)를 활용한 웹 개발 개인 프로젝트입니다.
                        </h2>

                    </div>

                </div>
            </div>
        </>
    )
}

export default Main;
